import React, {Component} from "react";
import { connect } from "react-redux";


const GeneralInfoEdit = ({referenceNumber, datePlaced, trackingNumber, orderStatus, handleChange}) => {

	return(
            <div id='OrderView_General_Details'>
                <div className="form-group">
                  <label htmlFor="ref"><h4 style={{fontWeight: 'bold'}}>Reference #</h4></label>
                  <input
                    type="text"
                    className="form-control"
                    id="ref"
                    required
                    value={referenceNumber || ''}
                    onChange={(e) => handleChange(e)}
                    name="ref"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="date"><h4 style={{fontWeight: 'bold'}}>Date Placed</h4></label>
                  <input
                    type="text"
                    className="form-control"
                    id="date"
                    value={datePlaced || ''}
                    onChange={handleChange}
                    name="date"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="tracking"><h4 style={{fontWeight: 'bold'}}>Tracking #</h4></label>
                  <input
                    type="text"
                    className="form-control"
                    id="tracking"
                    value={trackingNumber || ''}
                    onChange={handleChange}
                    name="tracking"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="message">Permission Type</label>
                  <input
                    type="text"
                    className="form-control"
                    id="message"
                    value={this.state.permissionType || ''}
                    onChange={handleChange}
                    name="permissionType"
                  />
                </div>
                {/* <table>
                    <tr>
                        <td>/td>
                        <td><h4>{referenceNumber}</h4></td>
                    </tr>
                    <tr>
                        <td></td>
                        <td><h4>{datePlaced}</h4></td>
                    </tr>
                    <tr>
                        <td></td>
                        <td><h4>{trackingNumber}</h4></td>
                    </tr>
                    <tr>
                        <td><h4 style={{fontWeight: 'bold'}}>Status</h4></td>
                        <td><h4>{orderStatus}</h4></td>
                    </tr>
                </table> */}
            </div>

	)
}



class GeneralInfo extends Component {
	constructor(props) {
	  super(props);

	  this.getGeneralInfo = this.getGeneralInfo.bind(this);

	  this.state = {
        referenceNumber: "",
		datePlaced: "",
        orderStatus: "",
        trackingNumber: "",
	 };
	}

	// This gets the users when the component loads
	componentDidMount() {
		this.getGeneralInfo(this.props.order)
	}

	getGeneralInfo(order) {
        this.setState({
            referenceNumber: order.referenceNumber,
            datePlaced: order.datePlaced,
            orderStatus: order.orderStatus,
            trackingNumber: order.trackingNumber
        });
	}

    handleInputChange(e) {
        const target = e.target;
        const value = target.type === 'checkbox' ? target.checked : target.value;
        const name = target.name;

        this.setState({
        [name]: value
        });
    }

	render() {
		const {order, viewOnly} = this.props;

		const {referenceNumber, datePlaced, orderStatus, trackingNumber} = this.state;

        if (viewOnly) {
            return (
                <div id='OrderView_General_Details'>
                    <table>
                        <tr>
                            <td><h4 style={{fontWeight: 'bold'}}>Reference #</h4></td>
                            <td><h4>{referenceNumber}</h4></td>
                        </tr>
                        <tr>
                            <td><h4 style={{fontWeight: 'bold'}}>Date Placed</h4></td>
                            <td><h4>{datePlaced}</h4></td>
                        </tr>
                        <tr>
                            <td><h4 style={{fontWeight: 'bold'}}>Tracking #</h4></td>
                            <td><h4>{trackingNumber}</h4></td>
                        </tr>
                        <tr>
                            <td><h4 style={{fontWeight: 'bold'}}>Status</h4></td>
                            <td><h4>{orderStatus}</h4></td>
                        </tr>
                    </table>
                </div>
            );	
        } else {
            return (
                <GeneralInfoEdit handleChange={this.handleInputChange} referenceNumber={referenceNumber} datePlaced= {datePlaced} trackingNumber={trackingNumber} orderStatus={orderStatus} />
            )
        }
	}
  }


  // Mapping only the parts of the redux store that we want to work with on this component
  const mapStateToProps = (state) => {	
	return {
	};
  };

export default connect(mapStateToProps, {  })(GeneralInfo);
